import React from 'react';

const Navigation = ({ onRouteChange, isSignedIn }) => {
    if (isSignedIn) {
      return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
          <p onClick={() => onRouteChange('signout')} className='f4 link dim black pa3 pointer ba b--black bw2 mr2' style={{borderWidth: "3px",borderColor: "black", borderRadius: "30px"}}>Sign Out</p>
        </nav>
      );
    } else {
      return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
          <p onClick={() => onRouteChange('about')} className='f4 link dim black pa3 pointer ba b--black bw2 mr2' style={{borderWidth: "3px",borderColor: "black", borderRadius: "30px"}}>About</p>
          <p onClick={() => onRouteChange('deveopers')} className='f4 link dim black pa3 pointer ba b--black mr2' style={{borderWidth: "3px",borderColor: "black", borderRadius: "30px"}}>Developers</p>
          <p onClick={() => onRouteChange('signin')} className='f4 link dim black pa3 pointer ba b--black bw2 mr2' style={{borderWidth: "3px",borderColor: "black", borderRadius: "30px"}}>Sign In</p>
          <p onClick={() => onRouteChange('register')} className='f4 link dim black pa3 pointer ba b--black mr2' style={{borderWidth: "3px",borderColor: "black", borderRadius: "30px"}}>Register</p>
        </nav>
      );
    }
}

export default Navigation;
